import React from 'react'

//global variable
var mobileno=8096556812;
class myclass extends React.Component{

    //class component
    id=1001;
    email="balu@gmail.com"
    //constructor
    constructor(props){
        super(props);
    }
    myfun()
    {
        return "this is own function";
    }

//prepare the component input
render()
{
    var name="kumar";
    return (<>
    <div className="container p-5">

     <h1>REACT CLASS COMPONENT</h1>

     {this.id}-{name}-{this.email}-{this.myfun()}-{mobileno}

    </div>
    </>);
}
}
export default myclass
